Publisher.showRank = function() {
    console.log('showRank');
    Publisher.initRankTable();
    Publisher.getGlobalRank();
    Publisher.getFriendsRank();
};

Publisher.initRankTable = function(){
    var rankContainer = document.getElementById('rank');
    var ranklistContainer = document.getElementById('rank_list');
    var ranklistCloseBt = document.getElementById('rank_close_bt');
    rankContainer.style.display = 'block';
    ranklistCloseBt.addEventListener("click", function(){
        rankContainer.style.display = 'none';
        ranklistContainer.innerHTML = "";
    });
}

Publisher.getGlobalRank = function(){
    FBInstant.getLeaderboardAsync(LBName)
  .then(function(leaderboard) {
    return leaderboard.getEntriesAsync();
  })
  .then(function(entries) {
    var ranklistContainer = document.getElementById('rank_list');
    for (var i =  0 ; i < entries.length; i++) {
            ranklistContainer.insertAdjacentHTML('beforeend', '<tr><td class="rank">'+entries[i].getRank()+'</td><td class="team">'+entries[i].getPlayer().getName()+'</td><td class="points">'+entries[i].getScore()+'</td></tr>');
    }
  });
}

Publisher.getFriendsRank = function(){
    FBInstant.getLeaderboardAsync(LBName)
  .then(function(leaderboard) {
    return leaderboard.getConnectedPlayerEntriesAsync();
  })
  .then(function(entries) {
    console.log(entries.length); // 10
    console.log(entries[0].getRank()); // 1
    console.log(entries[0].getScore()); // 42
    console.log(entries[1].getRank()); // 2
    console.log(entries[1].getScore()); // 40
  });
}
function convertImgToBase64(url, callback, outputFormat) {
    console.log('converting image to base 64');
    var canvas = document.createElement('CANVAS');
    var ctx = canvas.getContext('2d');
    var img = new Image;
    img.crossOrigin = 'Anonymous';
    console.log('have image context');
    img.onload = function() {
        var dataURL = canvas.toDataURL(outputFormat || 'image/png');
        console.log('data url: ' + dataURL);
        callback.call(this, dataURL);
        // Clean up
        canvas = null;
    };
    img.src = url;
}
