Publisher.submitSessionScore = function(scoreValue, level) {
    try {
        Publisher.community.submitSessionScore({
            score: scoreValue,
            level: level,
            callback: function() {
                Publisher.showAdvertising();
                Publisher.analyticsScore(scoreValue);
            }
        });
    } catch (e) {}
};
